import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';

const Footer = () => {
    return (
      <footer className="footerSection">
          <Container fluid>
            <Row>
                <Col>
                </Col>
                <Col>
                </Col>
                <Col>
                </Col>
            </Row>  
          </Container>
      </footer>  
    )
}

export default Footer;
